import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import App from './App'
import Main from './Main'

function Router(){
    return(
        <div>
            <BrowserRouter>
                <Routes>
                    <Route path="*" element={<Main></Main>}></Route>
                    <Route path="/" element={<App></App>}></Route>
                </Routes>
            </BrowserRouter>
        </div>
    )
}

export default Router;
